import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { DragDropContext, Droppable, Draggable } from "react-beautiful-dnd";
import { addField, reorderFields } from "./redux/actions/formFieldActions";

import TextInput from "./components/textInput";
import TextArea from "./components/textArea";
import DropDown from "./components/dropDown";
import CheckBox from "./components/checkBox";
import DatePicker from "./components/datePicker";
import RadioButtons from "./components/radioButtons";
import FileUpload from "./components/fileUpload";

const FormField = ({ field }) => {
  const dispatch = useDispatch();
  const components = {
    textInput: <TextInput {...field} />,
    textArea: <TextArea {...field} />,
    selectDropdown: <DropDown {...field} />,
    checkbox: <CheckBox {...field} />,
    datePicker: <DatePicker {...field} />,
    radioButtons: <RadioButtons {...field} />,
    fileUpload: <FileUpload {...field} />,
  };

  return (
    <div style={{ padding: "10px", margin: "10px 0", border: "1px solid #ddd", borderRadius: "4px" }}>
      <input
        type="text"
        value={field.label}
        onChange={(e) => dispatch({ type: "UPDATE_LABEL", payload: { id: field.id, label: e.target.value } })}
        style={{ width: "100%", padding: "8px", marginBottom: "8px", border: "1px solid #ccc" }}
        placeholder="Field Label"
      />
      {components[field.type]}
    </div>
  );
};

const App = () => {
  const dispatch = useDispatch();
  const formFields = useSelector((state) => state.formFields);
  const [components] = useState([
    { id: "textInput", label: "Text Input" },
    { id: "textArea", label: "Text Area" },
    { id: "selectDropdown", label: "Dropdown" },
    { id: "checkbox", label: "Checkbox" },
    { id: "datePicker", label: "Date Picker" },
    { id: "radioButtons", label: "Radio Buttons" },
    { id: "fileUpload", label: "File Upload" },
  ]);

  const handleOnDragEnd = (result) => {
    const { destination, source } = result;
    if (!destination) return;

    if (source.droppableId === "sidebar" && destination.droppableId === "canvas") {
      const newField = {
        id: Date.now(),
        type: source.draggableId,
        label: "New Field",
        placeholder: "Enter text...",
        options: ["Option 1"],
        value: "",
        required: false,
      };
      dispatch(addField(newField));
    } else if (source.droppableId === "canvas" && destination.droppableId === "canvas") {
      const reorderedFields = Array.from(formFields);
      const [movedField] = reorderedFields.splice(source.index, 1);
      reorderedFields.splice(destination.index, 0, movedField);
      dispatch(reorderFields(reorderedFields));
    }
  };

  return (
    <div style={{ display: "flex", height: "100vh", padding: "20px", gap: "20px" }}>
      <DragDropContext onDragEnd={handleOnDragEnd}>
        <Droppable droppableId="sidebar" isDropDisabled>
          {(provided) => (
            <div
              ref={provided.innerRef}
              {...provided.droppableProps}
              style={{ width: "200px", padding: "10px", backgroundColor: "#f0f0f0", borderRadius: "8px" }}
            >
              <h3>Components</h3>
              {components.map((comp, index) => (
                <Draggable key={comp.id} draggableId={comp.id} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      style={{
                        padding: "8px",
                        marginBottom: "8px",
                        backgroundColor: "#fff",
                        border: "1px solid #ccc",
                        borderRadius: "4px",
                        cursor: "grab",
                        opacity: provided.isDragging ? 0.5 : 1,
                        boxShadow: provided.isDragging ? "0 4px 8px rgba(0, 0, 0, 0.1)" : "none",
                      }}
                    >
                      {comp.label}
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>

        <Droppable droppableId="canvas">
          {(provided) => (
            <div
              ref={provided.innerRef}
              {...provided.droppableProps}
              style={{ flex: 1, padding: "10px", backgroundColor: "#f9f9f9", borderRadius: "8px", border: "2px dashed #ddd" }}
            >
              <h3>Form Preview</h3>
              {formFields.map((field, index) => (
                <Draggable key={field.id} draggableId={String(field.id)} index={index}>
                  {(provided) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      style={{ marginBottom: "10px" }}
                    >
                      <FormField field={field} />
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      </DragDropContext>
    </div>
  );
};

export default App;
